import React from "react";
import styles from "./css/weekly.module.css";
const WeeklyOverview = () => {
    return ( 
        <React.Fragment>
            <div className={styles.parent}>
                <div className={styles.week}>This Weekâ€™s Overview</div>
                <select className="form-select" style={{width:'100%',height:'40px',WebkitAppearance:'none',MozAppearance:'none',paddingLeft:'10px'}}>
                  <option defaultValue>2021</option>
                  <option value="1">2020</option>
                  <option value="2">2019</option>
                  <option value="3">2018</option>
                </select>
             
            </div>
        </React.Fragment>
     );
}
 
export default WeeklyOverview;
